import os
import requests
import json
from dotenv import load_dotenv

load_dotenv()

OPENAI_URL = os.getenv("OPENAI_URL")
OPENAI_MODEL = os.getenv("OPENAI_MODEL")
OPENAI_API_KEY = os.getenv("OPENAI_API_KEY")

def call_gpt(chat_payload: dict) -> dict:
    """
    Send the given payload as-is to OPENAI_URL. This allows forwarding
    messages that include image data URIs in the same structure used
    by the local frontend/API.

    chat_payload example (flexible):
    {
        "model": "...",            # optional
        "messages": [ ... ],      # can be complex entries with image_url or files
        "temperature": 0.0
    }
    """
    headers = {
        "Authorization": OPENAI_API_KEY,
        "Content-Type": "application/json",
    }

    # Forward the payload directly so callers can include files/image data URIs
    body = chat_payload.copy()
    # default model if not provided
    if "model" not in body and OPENAI_MODEL:
        body["model"] = OPENAI_MODEL
    if "temperature" not in body:
        body["temperature"] = 0.0

    response = requests.post(
        OPENAI_URL,
        headers=headers,
        json=body,
        timeout=100,
    )

    response.raise_for_status()
    return response.json()


def gpt_baseline(q_text: str, image_data_url: str, debug: bool = False) -> str:
    """
    Build a minimal chat-style payload (messages array) that includes the question text
    and a base64 image data URL, then call call_gpt. Returns the model's reply string.
    This matches the same messages format used by test_call_gpt / your frontend.
    """
    # system + user messages using the same `content` shape your frontend uses
    system_msg = {
        "role": "system",
        "content": [
            {"text": "You are a concise and accurate technical assistant. Answer the question directly.", "type": "text"}
        ]
    }
    if image_data_url is not None and len(image_data_url) > 0:
        user_msg = {
            "role": "user",
            "content": [
                {"text": q_text, "type": "text"},
                {"image_url": {"url": image_data_url}, "type": "image_url"}
            ],
            "files": [
                {
                    "content": image_data_url,
                    "id": 1,
                    "name": "Screenshot #1",
                    "size": "100.0 KB",
                    "type": "image-screenshot"
                }
            ]
        }
    else:
        user_msg = {
            "role": "user",
            "content": [
                {"text": q_text, "type": "text"}
            ],
            "files": []
        }

    payload = {
        "messages": [system_msg, user_msg],
    }
    # allow call_gpt to fill in model / temperature defaults
    res = call_gpt(payload)

    # extract text reply robustly
    reply = None
    if isinstance(res, dict):
        # Chat-style response
        choices = res.get("choices")
        if isinstance(choices, list) and choices:
            first = choices[0]
            # new OpenAI chat: choices[0].message.content
            msg = first.get("message") if isinstance(first, dict) else None
            if isinstance(msg, dict):
                content = msg.get("content")
                if isinstance(content, str):
                    reply = content
                else:
                    reply = json.dumps(content)
            # some servers return choices[0].text
            elif "text" in first:
                reply = first.get("text")
        # Responses-style fallbacks
        if not reply:
            if isinstance(res.get("output_text"), str):
                reply = res["output_text"]
            elif "output" in res:
                reply = str(res["output"])

    # fallback to stringifying whole response
    if reply is None:
        reply = json.dumps(res)

    if debug:
        print(f"========== GPT Baseline Reply ({'with' if image_data_url and len(image_data_url) > 0 else 'without'} image) ==========")
        print(reply)
        print()

    return reply


def test_call_gpt():
    chat_payload = {
        "messages": [
            {
                "role": "system",
                "content": "You are a concise and accurate technical assistant."
            },
            {
                "role": "user",
                "content": "Why are driver.Mem events split into two groups?"
            }
        ]
    }

    result = call_gpt(chat_payload)

    reply = result["choices"][0]["message"]["content"]
    print("Model reply:")
    print(reply)


